import React from "react";

export default function CocktailsList(props) {
  return (
    <div class="row">
      {props.drinks.map(({ strDrinkThumb, strDrink, strIBA, strAlcoholic }) => (
        <div className="col s1">
          <div className={strDrink}>
            <img src={strDrinkThumb} />
            {strDrink}
            <br />
            {strIBA}
            <br />
            {strAlcoholic}
          </div>

          <button class="pure-button pure-button-primary">
            Add to Favourites
          </button>
        </div>
      ))}
    </div>
  );
}
